43X)"]},{"cell_type":"markdown","id":"ac0b0f72","metadata":{"papermill":{"duration":0.006875,"end_time":"2024-01-22T10:46:55.077641","exception":false,"start_time":"2024-01-22T10:46:55.070766","status":"completed"},"tags":[]},"source":["# Sentiments"]},{"cell_type":"markdown","id":"4ebf9436","metadata":{"papermill":{"duration":0.006781,"end_time":"2024-01-22T10:46:55.092218","exception":false,"start_time":"2024-01-22T10:46:55.085437","status":"completed"},"tags":[]},"source":["## We can retrieve these lexicons using the get_sentiments() function. We can implement this as follows:"]},{"cell_type":"code","execution_count":4,"id":"17cfb961","metadata":{"execution":{"iopub.execute_input":"2024-01-22T10:46:55.109665Z","iopub.status.busy":"2024-01-22T10:46:55.107772Z","iopub.status.idle":"2024-01-22T10:46:55.179769Z","shell.execute_reply":"2024-01-22T10:46:55.178025Z"},"papermill":{"duration":0.083273,"end_time":"2024-01-22T10:46:55.182471","exception":false,"start_time":"2024-01-22T10:46:55.099198","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 6786 × 2</caption>\n","<thead>\n","\t<tr><th scope=col>word</th><th scope=col>sentiment</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>2-faces      </td><td>negative</td></tr>\n","\t<tr><td>abnormal     </td><td>negative</td></tr>\n","\t<tr><td>abolish      </td><td>negative</td></tr>\n","\t<tr><td>abominable   </td><td>negative</td></tr>\n","\t<tr><td>abominably   </td><td>negative</td></tr>\n","\t<tr><td>abominate    </td><td>negative</td></tr>\n","\t<tr><td>abomination  </td><td>negative</td></tr>\n","\t<tr><td>abort        </td><td>negative</td></tr>\n","\t<tr><td>aborted      </td><td>negative</td></tr>\n","\t<tr><td>aborts       </td><td>negative</td></tr>\n","\t<tr><td>abound       </td><td>positive</td></tr>\n","\t<tr><td>abounds      </td><td>positive</td></tr>\n","\t<tr><td>